import React from 'react'
import {photos} from './post'
import Header from './components/Header'
const App = () => {
  return (
  
    <div style={{ flexDirection: 'row' }}>
      <div id='container'>
        <div>
          <Header />
        </div>
        <div>
        {
          photos.map((e, i) => (
            <div key={i} id='card' >
              <h3>{e.title} </h3>
              <img src={e.url} alt="descriptive text"/>
            </div>
          ))
        }
        </div>
      </div>
    </div>
  )
}
export default App

